import{_ as A,c as g,o as B,a2 as C}from"./chunks/framework.BJvAGJ4I.js";const D=JSON.parse('{"title":"Helios Architecture","description":"","frontmatter":{},"headers":[],"relativePath":"helios-architecture.md","filePath":"helios-architecture.md"}'),I={name:"helios-architecture.md"},Q=C('<h1 id="helios-architecture" tabindex="-1">Helios Architecture <a class="header-anchor" href="#helios-architecture" aria-label="Permalink to &quot;Helios Architecture&quot;">â€‹</a></h1><p>To meet the requirements of Amazon Kinesis users looking to explore and analyze their event streams, Helios is built around three key components:</p><ol><li>Storage - A database optimized for querying streaming data, specifically an Online Analytical Processing (OLAP) database capable of handling high-volume, real-time data ingestion, and delivering fast query performance for analytical workloads.</li><li>Connection - An ingestion mechanism to efficiently transfer events from Kinesis streams into our chosen database.</li><li>Interface - A user-friendly graphical interface allowing users to conduct analyses and visualize results.</li></ol><p><img src="data:image/png;base64," alt=""></p><p>Given that potential Helios users are already leveraging Amazon Kinesis, it made sense to host all of Helios&#39; infrastructure within the AWS ecosystem.</p><p>In the following section, we will dive into the specific services we chose, explaining how each component contributes to Helios&#39; functionality and performance.</p><p>Our design decisions and their associated tradeoffs will be explored in the â€œBuilding Helios: Design Choicesâ€ section of the case study, while this section is focused on how we architected Helios.</p><h2 id="storage" tabindex="-1">Storage <a class="header-anchor" href="#storage" aria-label="Permalink to &quot;Storage&quot;">â€‹</a></h2><p>Tying back to our example use case of e-commerce user analytics, we required a database optimized for analytical queries. A typical analytical query might ask, &quot;What is the average order value for customers who used a discount code in the past hour?&quot; Such queries demand specific capabilities from our database.</p><p>As defined in &quot;Designing Data-Intensive Applications&quot; (DDIA), analytical queries typically scan millions of records, reading only a few columns per record, and calculate aggregate statistics rather than returning raw data. This definition guided our approach to storage architecture.</p><p>Databases typically fall into two categories: <strong>Online Analytical Processing (OLAP)</strong> and <strong>Online Transaction Processing (OLTP)</strong>, each optimized for distinct use cases. <strong>OLAP</strong> systems, primarily used for analytics, are designed to process millions of records per query. In contrast, <strong>OLTP</strong> systems typically process small numbers of records per query using keys and indexes for quick data retrieval. The fundamental difference lies in their access patterns: OLTP prioritizes small-scale transactions, while OLAP focuses on large-scale data analysis.</p><p>Ultimately, we chose ClickHouse as our OLAP database to power Helios&#39; analytical capabilities. <em>Later(link!)</em> in this case study, we will provide a detailed exploration of our database selection process, including the factors that influenced our decision.</p><p>The following diagram illustrates our storage architecture:</p><h3 id="clickhouse-database-server" tabindex="-1">ClickHouse Database Server <a class="header-anchor" href="#clickhouse-database-server" aria-label="Permalink to &quot;ClickHouse Database Server&quot;">â€‹</a></h3><p><em><img src="data:image/png;base64," alt=""></em></p><p>The main functions of the ClickHouse database are to store event data consumed from Kinesis streams and to make this data available for querying. The database is deployed on an Amazon EC2 instance (i.e. virtual server).</p><p>With storage in place, the next phase of our architecture design was to implement an integration between a userâ€™s Amazon Kinesis streams and the ClickHouse instance.</p><h2 id="connection" tabindex="-1">Connection <a class="header-anchor" href="#connection" aria-label="Permalink to &quot;Connection&quot;">â€‹</a></h2><h3 id="" tabindex="-1"><img src="data:image/png;base64," alt=""> <a class="header-anchor" href="#" aria-label="Permalink to &quot;![][image3]&quot;">â€‹</a></h3><p>Efficiently transferring events from Kinesis streams to our ClickHouse database presented a challenge. We needed a solution that could handle high-volume data ingestion, perform necessary decoding, and ensure reliable delivery.</p><p>To address this, we developed a custom AWS Lambda function as our stream processor. This approach allows us to:</p><ul><li>Decode and parse Kinesis event data</li><li>Implement custom error handling</li><li>Dynamically map data to appropriate ClickHouse tables</li><li>Perform efficient inserts</li></ul><p>By leveraging Lambda, we created a flexible and scalable solution tailored to our specific data processing needs. Let&#39;s explore how this custom processor works in detail.</p><h3 id="-1" tabindex="-1"><a class="header-anchor" href="#-1" aria-label="Permalink to &quot;&quot;">â€‹</a></h3><h3 id="kinesis-to-clickhouse-integration" tabindex="-1">Kinesis to ClickHouse Integration <a class="header-anchor" href="#kinesis-to-clickhouse-integration" aria-label="Permalink to &quot;Kinesis to ClickHouse Integration&quot;">â€‹</a></h3><p>Heliosâ€™ Lambda Processor is an AWS serverless function that serves as a connector between Amazon Kinesis event streams and ClickHouse tables. The Lambdaâ€™s main roles are to decode the events from the Kinesis stream and insert them into the ClickHouse database. The full process involves retrieving table information, preparing data for batch insertion, and attempting to insert the data into ClickHouse.</p><p>Using an event based trigger, the function ingests <em>event data(tooltip)</em> from AWS Kinesis streams, and decodes the Kinesis event payload into a JSON object.</p><p><img src="data:image/png;base64," alt=""></p><p><img src="data:image/png;base64," alt=""></p><p>Once the Lambda decodes the payload from a stream, the data needs to be sent to the associated destination table within Clickhouse. To retrieve the table ID, the Lambda interacts with a key-value database, DynamoDB, which contains a mapping of stream IDs to table IDs.</p><p>In the DynamoDB table we associate one AWS Kinesis stream to one Clickhouse table. This not only eliminates potential schema errors when ingesting data from multiple streams, but also prevents human error if users try to connect multiple streams to one table.</p><p>While the storage and connection components form the backbone of Helios, the analysis layer serves as the user-facing interface, bridging the gap between raw data and actionable insights.</p><h2 id="interface" tabindex="-1">Interface <a class="header-anchor" href="#interface" aria-label="Permalink to &quot;Interface&quot;">â€‹</a></h2><h3 id="application-server" tabindex="-1">Application Server <a class="header-anchor" href="#application-server" aria-label="Permalink to &quot;Application Server&quot;">â€‹</a></h3><p><img src="data:image/png;base64," alt=""></p><p>The Helios web application, hosted on an Amazon EC2 instance, serves as the primary interface for users. Implemented with a Flask backend and a React frontend, its core features include:</p><ol><li>An interactive SQL console for querying data from event streams, enabling real-time data analysis</li><li>An interface for connecting a data source, such as a Kinesis stream, to the Helios architecture</li></ol><p>Now that you have a good understanding of how Helios works, in the next section we will cover why we designed it in this way as well as the trade-offs made throughout the building of Helios. Here is our architecture so far: <img src="data:image/png;base64," alt=""></p>',38),E=[Q];function i(e,o,c,R,r,u){return B(),g("div",null,E)}const w=A(I,[["render",i]]);export{D as __pageData,w as default};
